svg.script:

let landRoot = document.getElementById('ClumsyValleyLandPlot');
let landBase = document.getElementById('tundra-base');
let farmingNameId = document.getElementById('farming-name');
let farmingCoordsId = document.getElementById('farming-coords');
let farmingFCId = document.getElementById('farming-fc');

let audioValley = "";
let audioTheme = "";

// valley-url
let valleyURL = document.getElementById('valley-url');

if (valleyURL) {
  valleyURL.addEventListener('click', () => {
    let clickUrlAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    clickUrlAudio.volume = 0.6;
    clickUrlAudio.play();
  });
};

// png-url
let pngURL = document.getElementById('png-url');

if (pngURL) {
  pngURL.addEventListener('click', () => {
    let clickUrlAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    clickUrlAudio.volume = 0.6;
    clickUrlAudio.play();
  });
};

// svg-url
let svgURL = document.getElementById('svg-url');

if (svgURL) {
  svgURL.addEventListener('click', () => {
    let clickUrlAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    clickUrlAudio.volume = 0.6;
    clickUrlAudio.play();
  });
};

// tree animation
let tree = document.getElementById('tree-animated');
let treeDefault = document.getElementById('tree-default');
let treeAnimated = document.getElementById('tree-snowfall');

if (tree) {
  tree.addEventListener('click', () => {
    let treeAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    treeAudio.volume = 0.6;
    treeAudio.play();

    treeDefault.classList.toggle('activate');
    treeAnimated.classList.toggle('activate');

    setTimeout(() => {
      treeDefault.classList.remove('activate');
      treeAnimated.classList.remove('activate');
    }, 3000);
  });
};

// lumi animation
let lumi = document.getElementById('lumi-animation-click');
let lumiDefault = document.getElementById('lumi-animation1');
let lumiAnimated = document.getElementById('lumi-animation2');

if (lumi) {
  lumi.addEventListener('click', () => {
    let lumiAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    lumiAudio.volume = 0.6;
    lumiAudio.play();

    lumiDefault.classList.toggle('activate');
    lumiAnimated.classList.toggle('activate');

    setTimeout(() => {
      lumiDefault.classList.remove('activate');
      lumiAnimated.classList.remove('activate');
    }, 2000);
  });
};

// dondu animation
let dondu = document.getElementById('dondu-animation');
let donduDefault = document.getElementById('dondu-default');
let donduAnimated = document.getElementById('dondu-blush');

if (dondu) {
  dondu.addEventListener('click', () => {
    let donduAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    donduAudio.volume = 0.6;
    donduAudio.play();

    donduDefault.classList.toggle('activate');
    donduAnimated.classList.toggle('activate');

    setTimeout(() => {
      donduDefault.classList.remove('activate');
      donduAnimated.classList.remove('activate');
    }, 500);
  });
};

let landBaseEL = false;
let cheatcodeEL = false;
let farmingFCIdEL = false;
let ghostEL = false;

if (landBase && landRoot) {

  var visible = false;
  var cheatCodesVisible = false;

  if (!landBaseEL) {
    landBaseEL = true;
    landBase.addEventListener('click', () => {
      let genericClickAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
      genericClickAudio.volume = 0.6;
      genericClickAudio.play();

      landRoot.classList.toggle('menu-in');

      var getName, getCoords, getFC;
      var farmingName, farmingCoords, farmingFC;
      farmingFC = document.getElementById('farming-fc');

      if (!visible) {
        fetch('https://internal.clumsylabs.io/api/v1/metadata/land/5384')
        .then(response => response.json())
        .then(json => {

          // Return values from internal clumsy api
          getName = json["name"]
          getCoords = json["coords"]
          getFC = json["fc"]
          getLink = json["link"]
          getTrack = json["track"]
          getTheme = json["theme"]
          getGhost = json["ghost"]

          if (getGhost) {
            var bigGhost = false;
            let ghost = document.getElementById('ghost');
            if (ghost) {
              ghost.setAttribute("href", getGhost);
              ghost.setAttribute("opacity", "1");

              if (!ghostEL) {
                ghostEL = true;
                ghost.addEventListener('click', () => {
                  let genericClickAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
                  genericClickAudio.volume = 0.6;
                  genericClickAudio.play();

                  if (!bigGhost) {
                    bigGhost = true;
                    ghost.setAttribute("href", getGhost);
                    ghost.setAttribute("opacity", "1");
                    ghost.setAttribute("height", "70");
                    ghost.setAttribute("width", "70");
                    ghost.setAttribute("x", "10");
                    ghost.setAttribute("y", "-8");
                  } else {
                    bigGhost = false;
                    ghost.setAttribute("height", "20");
                    ghost.setAttribute("width", "20");
                    ghost.setAttribute("x", "70");
                    ghost.setAttribute("y", "3");
                  }
              })}
            };
          }

          if (getName) {
            farmingName = document.getElementById('farming-name');
            farmingName.innerHTML = getName;
            console.log("Name: ", getName)
          }

          if (getCoords) {
            farmingCoords = document.getElementById('farming-coords');
            farmingCoords.innerHTML = getCoords;
            console.log("Coordinates: ", getCoords)
          }

          if (getFC) {
            farmingFC.innerHTML = "FC: " + getFC;
            console.log("Farming cycles completed: ", getFC)

            if (getFC >= 1 && getFC <= 9) {
              console.log("Tier 1 Land")
              farmingFC.classList.add('tier1');
            } else if (getFC >= 10 && getFC <= 29) {
              console.log("Tier 2 Land")
              farmingFC.classList.add('tier2');
            } else if (getFC >= 30 && getFC <= 49) {
              console.log("Tier 3 Land")
              farmingFC.classList.add('tier3');
            } else if (getFC >= 50 && getFC <= 99) {
              console.log("Tier 4 Land")
              farmingFC.classList.add('tier4');
            } else if (getFC >= 100) {
              console.log("Tier 5 Land")
              farmingFC.classList.add('tier5');
            } else {
              console.log("Tier 0 Land")
            }
          } else {
            getFc = 0;
          }

          if (getLink) {
            let valleyUrl = document.getElementById('valley-url');
            valleyUrl.setAttribute("href", getLink);
            console.log("Valley link: ", getLink)
          }

        })
        .catch(error => {
          getName = "";
          getCoords = "";
          getFC = 0;
          getLink = "";
          getTrack = "";
          getTheme = "";
          getGhost = "";
        });
      }

      if (!farmingFCIdEL) {
        farmingFCIdEL = true;
        farmingFCId.addEventListener('click', () => {
          cheatCodesVisible = true

          if (cheatCodesVisible) {
            let cheatCodeAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/cheatcodeactivated.mp3");
            cheatCodeAudio.volume = 1;
            cheatCodeAudio.play();

            farmingFC.innerHTML = "Cheat Codes Activated..."
            farmingFC.setAttribute("filter", "url(#stats-cheatcode)");
            let bufferArray = [];
            let lastKeystrokeTime = Date.now();
            const cheatcode = (e) => {

              const latestKeystrokeTime = Date.now();
              if (latestKeystrokeTime - lastKeystrokeTime > 5000) {
                if (getFC) {
                  farmingFC.innerHTML = "FC: " + getFC;
                } else {
                  farmingFC.innerHTML = "FC: ";
                }
                farmingFC.setAttribute("filter", "url(#stats-fc)");
                bufferArray = [];
              }

              if (e.key == "ArrowUp") {
                key = '↑';
              } else if (e.key == "ArrowDown") {
                key = '↓';
              } else if (e.key == "ArrowLeft") {
                key = '←';
              } else if (e.key == "ArrowRight") {
                key = '→';
              } else if (e.key.length == 1) {
                key = e.key;
              } else {
                key = ""
              }

              // each key press either adds or removes a char
              if (e.key == "Backspace") {
                bufferArray = bufferArray.slice(0, -1);
              } else if (bufferArray.length < 12 && key != "") {
                bufferArray.push(key);
              }

              farmingFC.innerHTML = bufferArray.join("")

              const word = bufferArray.join('');
              if (word === 'disco') { /* DISCO */
                cheatCodeAudio.play();
                console.log('Clumsy Valley Party!');

                landRoot.classList.add('party');
                clearListener();

                setTimeout(() => {
                  landRoot.classList.remove('party');
                }, 10000);
              } else if (word == '↑↑↓↓←→ab') { /* CODE */
                cheatCodeAudio.play();
                console.log('Nonstop Party!!!');

                landRoot.classList.add('party');
                clearListener();
              } else if (word === 'rgb') { /* RGB */
                cheatCodeAudio.play();

                landBase.classList.add('party');
                clearListener();

                setTimeout(() => {
                  landBase.classList.remove('party');
                }, 10000);
              } else if (word === 'yeti') { /* YETI */
                let igloo = document.getElementById('igloo-animation');
                if (igloo) {
                  cheatCodeAudio.play();
                  let iglooAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
                  iglooAudio.volume = 0.6;
                  iglooAudio.play();

                  // igloo animation
                  let igloo1 = document.getElementById('igloo1-click-to-animate');
                  let igloo2 = document.getElementById('igloo2');
                  let igloo3 = document.getElementById('igloo3');
                  let igloo4 = document.getElementById('igloo4');

                  igloo1.classList.add('igloo1');
                  igloo2.classList.add('igloo2');
                  igloo3.classList.add('igloo3');
                  igloo4.classList.add('igloo4');

                  clearListener();

                  setTimeout(() => {
                    igloo1.classList.remove('igloo1');
                    igloo2.classList.remove('igloo2');
                    igloo3.classList.remove('igloo3');
                    igloo4.classList.remove('igloo4');
                  }, 1200);
                }
              } else if (word === 'aurora') { /* AURORA */
                cheatCodeAudio.play();

                let auroraId = document.getElementById('aurora-animation-cheatcode-type-aurora');
                let aurora1 = document.getElementById('aurora-1');
                let aurora2 = document.getElementById('aurora-2');
                let aurora3 = document.getElementById('aurora-3');
                let aurora4 = document.getElementById('aurora-4');
                let aurora5 = document.getElementById('aurora-5');

                auroraId.classList.remove('aurora-hide');
                aurora1.classList.remove('aurora-hide');
                aurora2.classList.remove('aurora-hide');
                aurora3.classList.remove('aurora-hide');
                aurora4.classList.remove('aurora-hide');
                aurora5.classList.remove('aurora-hide');

                aurora1.classList.add('aurora-1');
                aurora2.classList.add('aurora-2');
                aurora3.classList.add('aurora-3');
                aurora4.classList.add('aurora-4');
                aurora5.classList.add('aurora-5');

                clearListener();

                setTimeout(() => {
                  auroraId.classList.add('aurora-hide');
                  aurora1.classList.add('aurora-hide');
                  aurora2.classList.add('aurora-hide');
                  aurora3.classList.add('aurora-hide');
                  aurora4.classList.add('aurora-hide');
                  aurora5.classList.add('aurora-hide');

                  aurora1.classList.remove('aurora-1');
                  aurora2.classList.remove('aurora-2');
                  aurora3.classList.remove('aurora-3');
                  aurora4.classList.remove('aurora-4');
                  aurora5.classList.remove('aurora-5');
                }, 8000);
              } else if (word === 'hideme') { /* HIDEME */
                cheatCodeAudio.play();
                let items = ["snow-shrooms1", "snow-shrooms2", "snow-shrooms3", "grass1", "grass2", "grass3", "grass4", "snow-twig3",
                  "snow-twig2", "igloo-animation", "snowglobe-animation-loop", 
                  "iceblock", "iceblock_copy", "berry-twig", "mountain-1", "tree-animated", "tree-stump", "campfire-animation-loop",
                  "snow-carrot", "coins", "fishtail", "sword", "viking-helmet", "lumi-animation-click", "skull", "dondu-animation",
                  "chest", "log", "black-ice", "aurora-animation-cheatcode-type-aurora"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    item.setAttribute("opacity", "0");
                  }
                }

                clearListener();

                setTimeout(() => {
                  for (let i = 0; i< items.length; i++) {
                    let item = document.getElementById(items[i]);
                    if (item) {
                      item.setAttribute("opacity", "1");
                    }
                  }
                }, 5000);
              } else if (word === 'usetheforce') { /* USETHEFORCE */
                cheatCodeAudio.play();
                let items = ["snow-shrooms1", "snow-shrooms2", "snow-shrooms3", "grass1", "grass2", "grass3", "grass4", "snow-twig3",
                  "snow-twig2", "igloo-animation", "snowglobe-animation-loop", 
                  "iceblock", "iceblock_copy", "berry-twig", "mountain-1", "tree-animated", "tree-stump", "campfire-animation-loop",
                  "snow-carrot", "coins", "fishtail", "sword", "viking-helmet", "lumi-animation-click", "skull", "dondu-animation",
                  "chest", "log", "black-ice"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    let randomnum = Math.floor(Math.random() * (60 - 10) + 10) / 10;
                    item.style.animation = "cg-anim-antigrav 4s linear " + randomnum + "s infinite";
                  }
                }

                clearListener();

                setTimeout(() => {
                  for (let i = 0; i< items.length; i++) {
                    let item = document.getElementById(items[i]);
                    if (item) {
                      item.style.animation = "";
                    }
                  }
                }, 30000);
              } else if (word == 'valley') { /* VALLEY */
                cheatCodeAudio.play();
                if (audioValley) {
                  audioValley.currentTime = 0;
                  audioValley.play();
                } else if (getTrack) {
                  audioValley = new Audio(getTrack);
                  audioValley.volume = 0.4;
                  audioValley.play();
                }
                clearListener();
              } else if (word == 'theme') { /* THEME */
                cheatCodeAudio.play();
                if (audioTheme) {
                  audioTheme.currentTime = 0;
                  audioTheme.play();
                } else if (getTheme) {
                  audioTheme = new Audio(getTheme);
                  audioTheme.volume = 0.4;
                  audioTheme.play();
                }
                clearListener();
              } else {
                if (this.keyTimeout) {clearTimeout(this.keyTimeout)}
                this.keyTimeout = setTimeout(() => {
                  clearListener();
                }, 5000);
              }

              lastKeystrokeTime = latestKeystrokeTime;
              }

            if (!cheatcodeEL){
              cheatcodeEL = true;
              document.addEventListener('keyup', cheatcode, true);
            }

            const clearListener = () => {
              cheatCodesVisible = false;
              cheatcodeEL = false;
              if (getFC) {
                  farmingFC.innerHTML = "FC: " + getFC;
                } else {
                  farmingFC.innerHTML = "FC: ";
                }
              farmingFC.setAttribute("filter", "url(#stats-fc)");
              bufferArray = [];
              document.removeEventListener('keyup', cheatcode, true);
            }
          }
        });
      }

      visible = !visible
      farmingNameId.classList.toggle('show-farming-stats');
      farmingCoordsId.classList.toggle('show-farming-stats');
      farmingFCId.classList.toggle('show-farming-stats');
      });     
}}
